"""
Given a string s and an array of strings words, return the number of words[i] that is a subsequence of s.

A subsequence of a string is a new string generated from the original string with some characters (can be none)
deleted without changing the relative order of the remaining characters.

For example, "ace" is a subsequence of "abcde".

Example 1:
    Input: s = "abcde", words = ["a","bb","acd","ace"]
    Output: 3
    Explanation: There are three strings in words that are a subsequence of s: "a", "acd", "ace".
Example 2:
    Input: s = "dsahjpjauf", words = ["ahjpjau","ja","ahbwzgqnuk","tnmlanowax"]
    Output: 2

Constraints:
    1 <= s.length <= 5 * 10^4
    1 <= words.length <= 5000
    1 <= words[i].length <= 50
    s and words[i] consist of only lowercase English letters.
"""
from typing import List
from collections import Counter
from bisect import bisect_left


class Solution:
    def numMatchingSubseq(self, s: str, words: List[str]) -> int:
        char_count = Counter(s)
        char_indexes = [[] for _ in range(26)]
        for i, c in enumerate(s):
            char_indexes[ord(c) - 97].append(i)

        def substring_in_string(substring):
            sub_char_count = Counter(substring)
            if len(substring) >= len(s):
                if s == substring:
                    return 1
                return 0
            if not all(char in char_count for char in sub_char_count) or not \
                    all(sub_char_count[c] <= char_count[c] for c in sub_char_count):
                return 0

            i = j = 0
            while j < len(substring):
                val = ord(substring[j]) - 97
                if char_indexes[val][-1] < i:
                    return 0
                k = bisect_left(char_indexes[val], i)
                i = char_indexes[val][k] + 1
                j += 1

            return j == len(substring)

        return sum(substring_in_string(word) for word in words)



